In our newest Amplify &amp; Inspire episode of #SRP, we talk to Noa Daniel - teacher, consultant &amp; CBO - about the power of photography in our classrooms. 

@noasbobs talks about decoding pictures in meaningful ways, &amp; the learning that comes with analysis. 

